import React from "react";
import { Outlet, useLocation, useNavigate } from "react-router-dom";
import Grid from "@mui/joy/Grid";
import HomeIcon from "@mui/icons-material/Home";
import BorderAllIcon from "@mui/icons-material/BorderAll";
import AssignmentIcon from "@mui/icons-material/Assignment";
import DateRangeIcon from "@mui/icons-material/DateRange";
import AccountBalanceWalletIcon from "@mui/icons-material/AccountBalanceWallet";
import CalendarMonthIcon from "@mui/icons-material/CalendarMonth";
import ChecklistIcon from "@mui/icons-material/Checklist";
import AccountCircleIcon from "@mui/icons-material/AccountCircle";
import Typography from "@mui/material/Typography";
import ButtonBase from "@mui/material/ButtonBase";



export default function Appartamento() {
  const location = useLocation();
  console.log(location.pathname);
  const navigate = useNavigate();
  const booleanArray = Array(length).fill(false);
  switch(location.pathname){

  }
  return (
    <Grid
      container
      style={{
        height: "100vh",
        width: "100wh",
        overflow: "auto",
      }}
    >
      <Grid
        container
        direction="column"
        justifyContent="flex-start"
        alignItems="center"
        style={{
          height: "100%",
          width: "20%",
          backgroundColor: "rgb(5, 22, 34)",
        }}
      >
        <Grid
          container
          direction="row"
          justifyContent="center"
          alignItems="center"
          style={{
            height: "30%",
            width: "100%",
            //backgroundColor: "rgb(54, 135, 200)",
          }}
        >
          <Grid
            container
            direction="row"
            justifyContent="center"
            alignItems="center"
            style={{
              height: "80%",
              width: "60%",
              backgroundColor: "rgb(252, 252, 252)",
              borderRadius: "10%",
            }}
          ></Grid>
        </Grid>
        <Grid
          container
          direction="column"
          justifyContent="flex-start"
          alignItems="center"
          style={{
            height: "70%",
            width: "100%",
            //backgroundColor: "rgb(154, 75, 200)",
          }}
        >
          <ButtonBase
            style={{
              backgroundColor: a ? 'rgb(194, 75, 70)' : 'rgb(94, 175, 70)',
              height: "8%",
              width: "60%",
              //backgroundColor: "rgb(94, 175, 70)",
            }}
            onClick={() => navigate("/")}
          >
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="center"
              style={{
                height: "100%",
                width: "100%",

              }}
            >
              <Grid
                container
                direction="row"
                justifyContent="center"
                alignItems="center"
                style={{
                  height: "100%",
                  width: "20%",
                  //backgroundColor: "rgb(24, 95, 170)",
                }}
              >
                <HomeIcon sx={{ color: "#fcfcfc" }} />
              </Grid>
              <Grid
                container
                direction="row"
                justifyContent="center"
                alignItems="center"
                style={{
                  height: "100%",
                  width: "80%",
                  //backgroundColor: "rgb(194, 75, 20)",
                }}
              >
                <Typography style={{ color: "#fcfcfc" }}>
                  Appartamenti
                </Typography>
              </Grid>
            </Grid>
          </ButtonBase>
          <ButtonBase
            style={{
              height: "8%",
